import React from 'react'
import { Switch, Route, NavLink } from "react-router-dom";
import "./style.css";

const Profile = () => <div>You're on the Profile Tab</div>;
const Comments = () => <div>You're on the Comments Tab</div>;
const Contact = () => <div>You're on the Contact Tab</div>;


export default function Contributions(props) {
    const { path } = props.match;
    return (
        <div>
            <div className="links">
          <NavLink to={`${path}`} ActiveClassName="active" className="link" >profile</NavLink>
          <NavLink to={`${path}comments`} ActiveClassName="active" className="link">Comments</NavLink>
          <NavLink to={`${path}contact`} ActiveClassName="active" className="link">Contact</NavLink>
        </div>
        <div className="tabs">
          <Switch>
            <Route exact strict path={`${path}`} component={Profile} />
            <Route exact strict path={`${path}comments`} component={Comments} />
            <Route exact path={`${path}contact`} component={Contact} />
          </Switch>
        </div>
        </div>
    )
}
